import { render } from '@testing-library/react'
import React from 'react'
import './Modal.css'

export default class Modal extends React.Component {
    render() {
        return (
            <React.Fragment>
                <button>Open Modal</button>

                <div className='Modal'/>
                <div className='Modal-body'>
                    <h1>Modal title</h1>
                    <p>123</p>
                    <button>close</button>
                </div>
            </React.Fragment>
        )
    }
}
